function ChoixS1_1(parcours, form, nb_choix, nb_suivi)
{
	document.getElementById("Valider").type = "hidden";
	if (nb_choix>1)
	{
		i1 =  form.UEsup1.selectedIndex;
		if (i1>0)
		{
			i = 1;
			j = 1;
			form.UEsup2.selectedIndex = 0;
			while (j<form.UEsup2.options.length)
			{
				if (i != i1)
				{
					form.UEsup2.options[j].text=form.UEsup1.options[i].text;
					j++;
				}
				i++;
			}
		}
		else
		{
			form.UEsup2.selectedIndex = 0;
			for (i=1; i<form.UEsup2.options.length; i++)
			{
				form.UEsup2.options[i].text = "";
			}
		}
		if (nb_choix>=3)
		{
      if (parcours != 'XXX') //'IMA'
      {
  			form.UEsup3.selectedIndex = 0;
  			for (i=1; i<form.UEsup3.options.length; i++)
  			{
  				form.UEsup3.options[i].text = "";
  			}
      }
		}
		if (nb_choix>=4)
		{
			form.UEsup4.selectedIndex = 0;
			for (i=1; i<form.UEsup4.options.length; i++)
			{
				form.UEsup4.options[i].text = "";
			}
		}
		if (nb_choix>=5)
		{
			form.UEsup5.selectedIndex = 0;
			for (i=1; i<form.UEsup5.options.length; i++)
			{
				form.UEsup5.options[i].text = "";
			}
		}
		if (nb_choix>=6)
		{
			form.UEsup6.selectedIndex = 0;
			for (i=1; i<form.UEsup6.options.length; i++)
			{
				form.UEsup6.options[i].text = "";
			}
		}
	}
	else
	{
		if (form.UEsup1.selectedIndex>0)
		{

			let UE2s = ["MODEL"];
			for(const ue  of UE2s) {
				UE = ue;
				if(form.UEsup1.options[form.UEsup1.selectedIndex].text == UE)
					{  alert("Information :\r\nVous avez choisi l'UE " + UE + ". Sachez que le cours de cette UE sera donn\351 en anglais, mais le TD/TME sera en fran\u00e7ais. Vous pouvez modifier vos voeux si vous le souhaitez.");}
			}
      var voeux = [];
      if(form.UEoblig1)
      {	voeux.push(form.UEoblig1.value);}
      if(form.UEoblig2)
      {	voeux.push(form.UEoblig2.value);}
      if(form.UEoblig3)
      {	voeux.push(form.UEoblig3.value);}

      if(voeux.length<nb_suivi && form.UEsup1)
      {	voeux.push(form.UEsup1.value);}
      if(voeux.length<nb_suivi && form.UEsup2)
      {	voeux.push(form.UEsup2.value);}
      if(voeux.length<nb_suivi && form.UEsup3)
      {	voeux.push(form.UEsup3.value);}
      voeux.sort();
      voeux_str = voeux.join();
    //	alert(voeux_str);



      //		UEpossibles = [];

      		if (nb_suivi == 5 && UEpossibles.indexOf(voeux_str) == -1)
      		{	alert('Information :\r\nLes 5 UE prioritaires (en incluant les UE obligatoires) ne permettent pas de d\351finir un emploi du temps compatible. Vous pouvez conserver cet ordre de priorit\351, mais vous ne pourrez pas obtenir toutes les UE que vous avez d\351finies comme prioritaires. Sinon vous pouvez modifier vos choix.\r\n\r\nBy using the 5 priority choices (including the mandatory lectures), no suitable scheduling can be designed. You can either modify your choices, or keep them as they are, but in this case, it is sure you will not obtain all the lectures with the highest priority.');}


			document.getElementById("Valider").type = "submit";
		}
	}
}

