function ChoixS2(parcours, form, index)
{
	Esup = [];
	if (form.UEsup1) {	Esup.push(form.UEsup1);}
	if (form.UEsup2) {	Esup.push(form.UEsup2);}
	if (form.UEsup3) {	Esup.push(form.UEsup3);}
	if (form.UEsup4) {	Esup.push(form.UEsup4);}
	if (form.UEsup5) {	Esup.push(form.UEsup5);}
	if (form.UEsup6) {	Esup.push(form.UEsup6);}
	if (form.UEsup7) {	Esup.push(form.UEsup7);}
	if (form.UEsup8) {	Esup.push(form.UEsup8);}
	if (form.UEsup9) {	Esup.push(form.UEsup9);}
	if (form.UEsup10) {	Esup.push(form.UEsup10);}
	nbVoeux = Esup.length;

	document.getElementById("Valider").type = "hidden";

	if (index+1 < nbVoeux)  // il reste des choix √† faire
	{
		i1 = Esup[index].selectedIndex;
		if (i1 > 0)  // 1 element choisi dans Voeu n¬∞ index
		{
			if (index<nbVoeux && (parcours!='IMA' || index!=1) && (parcours!='IQ' || index!=0))    //(index<nbVoeux && ((parcours!='IMA' && parcours!='IQ') || index!=1))
			{
				i = 1;
				j = 1;
					Esup[index+1].selectedIndex = 0;
					while (i<Esup[index].options.length)
					{
						if (i != i1)
						{
							Esup[index+1].options[j].text=Esup[index].options[i].text;
							j++;
						}
						i++;
					}
			}
		}
		// effacer choix √† partir de voeu index+1 ou +2
		if (i1 == 0)
		{ i0 = index + 1; }
		else
		{ i0 = index + 2; }

		for (let i=i0; i<nbVoeux; i++)
		{
			if ((parcours!='IMA' && (parcours!='IQ' || index!=0)) || (parcours=='IMA' && index==0 && i==1) || index>=2) // n'effacer que le necessaire dans IMA er IQ
			{
				Esup[i].selectedIndex = 0;
				for (let j=1; j<Esup[i].options.length; j++)
				{
					Esup[i].options[j].text = "";
				}
			}
		}
	}



		//// on peut ajouter des filtre et des tests ici

		res = true;
		for (let i=0; i<nbVoeux; i++)
		{
            ind = Esup[i].selectedIndex
			if (ind==0 || Esup[i].options[ind].text=='')  // pas correct si choix "vide" cf IMA o√π trop de lignes dans select
			{  res = false; }
		}
		if (res)
		{	 document.getElementById("Valider").type = "submit"; }
}

